import React from 'react';
import Slider from 'react-slick';
import "slick-carousel/slick/slick.css";
import "slick-carousel/slick/slick-theme.css";

const FeaturedProducts = ({ products = [] }) => {
  const settings = {
    dots: true,
    infinite: true,
    speed: 500,
    slidesToShow: 1, // Muestra un producto a la vez
    slidesToScroll: 1,
    responsive: [
      {
        breakpoint: 1024,
        settings: {
          slidesToShow: 1,
          slidesToScroll: 1,
          infinite: true,
          dots: true
        }
      },
      {
        breakpoint: 600,
        settings: {
          slidesToShow: 1,
          slidesToScroll: 1
        }
      }
    ]
  };
  

  return (
    <div className="featured-products-container">
      <Slider {...settings}>
        {products.map((product, index) => (
          <div key={index} className="featured-product-card">
            <img src="data:image/jpeg;base64," alt="Product Image"/>
            <h3 className="featured-product-title">{product.name}</h3>
            <p className="featured-product-description">{product.description}</p>
          </div>
        ))}
      </Slider>
    </div>
  );
};

export default FeaturedProducts;
